INSERT INTO `admin_content` VALUES (1,'Java 教程，Java 简介','Java 教程\nJava 是高级程序设计语言\nJava 语言的数组是这样写的：int [] a=new int [10];\n运行 javac 命令后，如果成功编译没有错误的话，会出现一个 HelloWorld.class 的文件\nJava 简介\nJava 是由 Sun Microsystems 公司于 1995 年 5 月推出的 Java 面向对象程序设计语言和 Java 平台的总称。由 James Gosling 和同事们共同研发，并在 1995 年正式推出。','111','https://igogo-test.oss-cn-shenzhen.aliyuncs.com/test/2022_9_10_80965924416393216.jpg','<p>Java 教程Java 是高<img src=\"https://igogo-test.oss-cn-shenzhen.aliyuncs.com/test/2022_12_27_119948147970568192.png\"><img src=\"https://igogo-test.oss-cn-shenzhen.aliyuncs.com/test/2022_12_27_119948177922093056.png\">级程序设计语言Java 语言的数组是这样写bcvxb<img src=\"https://igogo-test.oss-cn-shenzhen.aliyuncs.com/test/2022_12_27_119946390456528896.png\">的：int [] a=new int [10];运行 javac 命令后，如果成功编译没有错误的话，会出现一个 HelloWorld.class 的文件Java 简介Java 是由 Sun Microsystems 公司于 1995 年 5 月推出的 Java 面向对象程序设计语言和 Java 平台的总称。由 James Gosling 和同事们共同研发，并在 1995 年正式推出。Java 分为三个体系： JavaSE（J2SE）（Java2 Platform Standard Edition，java 平台标准版） JavaEE (J2EE)(Java 2 Platform,Enterprise Edition，java 平台企业版) JavaME (J2ME)(Java 2 Platform Micro Edition，java 平台微型版)。 2005 年 6 月，JavaOne 大会召开，SUN 公司公开 Java SE 6。此时，Java 的各种版本已经更名以取消其中的数字 \"2\"：J2EE 更名为 Java EE, J2SE 更名为 Java SE，J2ME 更名为 Java ME。 JDK（Java Development Kit&nbsp;）：编写 Java 程序的程序员使用的软件 JRE（Java Runtime Environment）：运行 Java 程序的用户使用的软件 Server JRE&nbsp;（Java SE Runtime Environment）：服务端使用的 Java 运行环境 SDK（Software Development Kit）：软件开发工具包，在 Java 中用于描述 1998 年～2006 年之间的 JDK DAO（Data Access Object）：数据访问接口，数据访问，顾名思义就是与数据库打交道 MVC（Model View Controller）：模型 (model)－视图 (view)－控制器 (controller) 的缩写，一种软件设计典范，用于组织代码用一种业务逻辑和数据显示分离的方法 面向对象程序设计的 3 个主要特征：封装性、继承性、多态性。<strong>封装性（encapsulation）：</strong>封装是一种信息隐蔽技术，它体现于类的说明，是对象的重要特性。封装使数据和加工该数据的方法（函数）封装为一个整体，以实现独立性很强的模块，使得用户只能见到对象的外特性（对象能接受哪些消息，具有哪些处理能力），而对象的内特性（保存内部状态的私有数据和实现加工能力的算法）对用户是隐蔽的。封装的目的在于把对象的设计者和对象的使用者分开，使用者不必知晓其行为实现的细节，只须用设计者提供的消息来访问该对象。<strong>继承性：</strong>继承性是子类共享其父类数据和方法的机制。它由类的派生功能体现。一个类直接继承其他类的全部描述，同时可修改和扩充。继承具有传递性。继承分为单继承（一个子类有一父类）和多重继承（一个类有多个父类）。类的对象是各自封闭的，如果没继承性机制，则类的对象中的数据、方法就会出现大量重复。继承不仅支持系统的可重用性，而且还促进系统的可扩充性。<strong>多态性：</strong>对象根据所接收的消息而做出动作。同一消息被不同的对象接受时可产生完全不同的行动，这种现象称为多态性。利用多态性用户可发送一个通用的信息，而将所有的实现细节都留给接受消息的对象自行决定，如是，同一消息即可调用不同的方法。例如：同样是 run 方法，飞鸟调用时是飞，野兽调用时是奔跑。多态性的实现受到继承性的支持，利用类继承的层次关系，把具有通用功能的协议存放在类层次中尽可能高的地方，而将实现这一功能的不同方法置于较低层次，这样，在这些低层次上生成的对象就能给通用消息以不同的响应。在 OOPL 中可通过在派生类中重定义基类函数（定义为重载函数或虚函数）来实现多态性。SDK——soft development kit，软件开发工具包。sdk 是一个大的概念，比如开发安卓应用，你需要安卓开发工具包，叫 android sdk，比如你开发 java 程序，需要用到 java sdk，所以一般使用 sdk 这个概念，你需要在前面加上限定词。JDK—— 可以理解为 java sdk，它是编写 java 程序，使用到的工具包，为程序员提供一些已经封装好的 java 类库。<a href=\"https://www.oschina.net/action/GoToLink?url=https%3A%2F%2Fwww.runoob.com%2Fw3cnote%2Fthe-different-of-jre-and-jdk.html\" rel=\"noopener noreferrer\" target=\"_blank\"><strong>JDK 和 JRE 的区别</strong></a><strong>JRE(Java Runtime Enviroment)</strong> 是 Java 的运行环境。面向 Java 程序的使用者，而不是开发者。如果你仅下载并安装了 JRE，那么你的系统只能运行 Java 程序。JRE 是运行 Java 程序所必须环境的集合，包含 JVM 标准实现及 Java 核心类库。它包括 Java 虚拟机、Java 平台核心类和支持文件。它不包含开发工具 (编译器、调试器等)。<strong>JDK(Java Development Kit)</strong> 又称 J2SDK (Java2 Software Development Kit)，是 Java 开发工具包，它提供了 Java 的开发环境 (提供了编译器 javac 等工具，用于将 java 文件编译为 class 文件) 和运行环境 (提&nbsp;供了 JVM 和 Runtime 辅助包，用于解析 class 文件使其得到运行)。如果你下载并安装了 JDK，那么你不仅可以开发 Java 程序，也同时拥有了运行 Java 程序的平台。JDK 是整个 Java 的核心，包括了 Java 运行环境 (JRE)，一堆 Java 工具 tools.jar 和 Java 标准类库 (rt.jar)。DOS 命令操作1. 快捷键：<strong>windows+R&nbsp;</strong>呼出 <strong>DOS</strong> 窗口。2. 输入 <strong>cmd</strong>(大小写不用区分) 回车，打开 <strong>DOS</strong> 窗口。常见的命令（基本都不区分大小写）1. 切换盘符：&nbsp;盘符（就是电脑的 C,D,E.. 盘） ： （如 ：&nbsp;&nbsp;<strong>D :&nbsp;</strong>)2. 查看文件或者文件夹：&nbsp;<strong>dir</strong>3. 进入某个文件夹：&nbsp;&nbsp;<strong>cd</strong> 文件夹名4. 返回上一级目录：&nbsp;&nbsp;<strong>cd..</strong>5. 清屏：&nbsp;<strong>cls</strong>6. 删除某个文件：&nbsp;<strong>del</strong>&nbsp;&nbsp;文件名7. 删除某个文件夹： <strong>rd</strong>&nbsp;文件夹名8. 退出 <strong>DOS</strong> 窗口： <strong>exit这些都是学 Java 之前稍微要了解一下的东西，随便看看就好啦，不用花太多时间在上面哦</strong></p>','2024-05-02 20:37:05','2022-09-04 01:51:57',1,1,1,0,0,19,14,0),(2,'河南唐河：中医药变身便民惠民“香饽饽”','9月26日晚，夜幕降临，河南省南阳市唐河县体育文化广场中医药文化夜市上，来了不少体验中医健康咨询、健康查体、免费测血压、体验针灸推拿等技术服务的群众。\n据介绍，唐河县农耕文化历史悠久，中医药文化具有一定的群众基础。该县也是河南省内重要的中药材种植大县，包括国家地理标志产品唐栀子、唐半夏在内的数十种中药材种植面积就达18万亩。\n为充分发挥中医药资源优势，唐河县从中医药信息化建设、中医师签约服务、中医药宣传推广入手，促进中医药走进基层、服务群众。','keyword','https://igogo-test.oss-cn-shenzhen.aliyuncs.com/test/2022_9_14_82518662937841664.jpg','<p><span style=\"color: rgb(38, 38, 38);\">9月26日晚，夜幕降临，河南省南阳市唐河县体育文化广场中医药文化夜市上，来了不少体验中医健康咨询、健康查体、免费测血压、体验针灸推拿等技术服务的群众。据介绍，唐河县农耕文化历史悠久，中医药文化具有一定的群众基础。该县也是河南省内重要的中药材种植大县，包括国家地理标志产品唐栀子、唐半夏在内的数十种中药材种植面积就达18万亩。为充分发挥中医药资源优势，唐河县从中医药信息化建设、中医师签约服务、中医药<img src=\"https://igogo-test.oss-cn-shenzhen.aliyuncs.com/test/2022_12_27_119953267961655296.png\">宣传推广入手，促进中医药走进基层、服务群众。推进中医药信息化建设。该县投资4000余万建设全县中医药信息化系统。目前，中医药信息化系统已基本实现县、乡、村三级实时心电传输、影像传输和远程会诊。配合县中医院的“经方云”平台的医疗诊断功能、“智慧中药房系统”远程配送功能和“中医师家庭医生签约”平台预防保健及宣教功能，实现了基层群众足不出户即可享受中医药服务。开展中医师家庭签约服务。全县统一签约手册、签约流程、签约档案、签约管理。全县统一行动，每月组织开展一次巡诊，每季度开展一次大型义诊，每年对签约人员开展一次健康体检。根据不同人群需求，与中医药特色优势相结合，为签约对象提供健康状态体质辨识、健康咨询指导、健康教育、健康干预、饮食调节、情志调节等治未病服务。截至目前，唐河县中医师家庭签约服务已在全县所有乡镇铺开，共签约81万余人，约19万户。开展中医药文化夜市活动。唐河县卫健委牵头在全县开展“中医药文化夜市”，设立各类体验活动区，为群众提供中医健康咨询、健康查体、免费测血压、体验针灸推拿等服务，免费向群众提供各种不同药膳、茶饮等。（马宏、高瞻）</span>&nbsp;</p>','2022-12-27 01:49:49','2022-09-14 18:38:11',3,1,1,1,0,0,0,0),(3,'标题4','dddddddddddd','ss',NULL,'<p>ddddddddddddddddddddddd</p>','2023-02-02 12:37:04','2023-02-02 12:37:04',1,1,0,0,0,0,0,0),(4,'dddddddddddddd','dd','ddd',NULL,'<p>ddddddddd</p>','2023-02-02 12:37:37','2023-02-02 12:37:37',1,1,1,1,0,0,0,0),(5,'测试内容','描述','关键字',NULL,'<p>test</p>','2024-05-02 20:10:51','2024-05-02 20:10:51',3,1,1,1,0,0,0,0);
