 \"    return {\\n\" +\n            \"      options: ${t.name}.options,\\n\" +\n            \"      trees: ${t.name}.trees,\\n\" +\n            \"      optionValueLabel: ${t.name}.optionValueLabel,\\n\" + \n            \"      pagination,\\n\" +\n            \"      dataSource: list,\\n\" +\n            \"      loading: loading.effects[\'${t.name}/query\'],\\n\" +\n            \"      onChange(page) {\\n\" +\n            \"        history.push({\\n\" +\n            \"          pathname,\\n\" +\n            \"          search: stringify({\\n\" +\n            \"            ...query,\\n\" +\n            \"            page: page.current,\\n\" +\n            \"            pageSize: page.pageSize,\\n\" +\n            \"          }),\\n\" +\n            \"        })\\n\" +\n            \"      },\\n\" +\n            \"      onDeleteItem: id => {\\n\" +\n            \"        dispatch({\\n\" +\n            \"          type: \'${t.name}/delete\',\\n\" +\n            \"          payload: id,\\n\" +\n            \"        }).then(() => {\\n\" +\n            \"          this.handleRefresh({\\n\" +\n            \"            page:\\n\" +\n            \"              list.length === 1 && pagination.current > 1\\n\" +\n            \"                ? pagination.current - 1\\n\" +\n            \"                : pagination.current,\\n\" +\n            \"          })\\n\" +\n            \"        })\\n\" +\n            \"      },\\n\" +\n            \"      onEditItem(item) {\\n\" +\n            \"        dispatch({\\n\" +\n            \"          type: \'${t.name}/showModal\',\\n\" +\n            \"          payload: {\\n\" +\n            \"            modalType: \'update\',\\n\" +\n            \"            currentItem: item,\\n\" +\n            \"          },\\n\" +\n            \"        })\\n\" +\n            \"      },\\n\" +\n            \"      onApplyItem(item) {\\n\" +\n            \"        dispatch({\\n\" +\n            \"          type: \'${t.name}/showModal\',\\n\" +\n            \"          payload: {\\n\" +\n            \"            modalType: \'apply\',\\n\" +\n            \"            currentItem: item,\\n\" +\n            \"          }\\n\" +\n            \"        })\\n\" +\n            \"      },\\n\" +\n            \"      onChildItem(item) {\\n\" +\n            \"        dispatch({\\n\" +\n            \"          type: \'${t.name}/showModal\',\\n\" +\n            \"          payload: {\\n\" +\n            \"            modalType: \'create\',\\n\" +\n            \"            currentItem: {...item},\\n\" +\n            \"          },\\n\" +\n            \"        })\\n\" +\n            \"      },\" +\n            \"    }\\n\" +\n            \"  }\\n\" +\n            \"\\n\" +\n            \"  get modalProps() {\\n\" +\n            \"    const { dispatch, ${t.name}, loading } = this.props\\n\" +\n            \"    const { currentItem, modalVisible, modalType,resourceTree,resourceIds } = ${t.name}\\n\" +\n            \"\\n\" +\n            \"    return {\\n\" +\n            \"      options: ${t.name}.options,\\n\" +\n            \"      trees: ${t.name}.trees,\\n\" +\n            \"      optionValueLabel: ${t.name}.optionValueLabel,\\n\" +\n            \"      item: modalType === \'create\' ? {...currentItem} : currentItem,\\n\" +\n            \"      visible: modalVisible,\\n\" +\n            \"      destroyOnClose: true,\\n\" +\n            \"      maskClosable: false,\\n\" +\n            \"      confirmLoading: loading.effects[`${t.name}/\\${modalType}`],\\n\" +\n            \"      resourceTree: resourceTree,\\n\" +\n            \"      resourceIds: resourceIds,\\n\" +\n            \"      title: `\\${\\n \" +\n                \"         modalType === \'create\' ? t`Create` : (modalType === \'update\' ? t`Update` : t`Apply`)\\n\" +\n                        \"      }`,\\n\" +\n                        \"      centered: true,\\n\" +\n                        \"      onOk: data => {\\n\" +\n                        \"     