pe == \'upload\') {\n            code += (\"          ${it.camelCase}:((values.${it.camelCase}?.fileList || values.${it.camelCase})?.map(value => {\\n\" +\n                    \"          if(value.url) return value.url;\\n\" +\n                    \"          if(value.response.payload) return value.response.payload;\\n\" +\n                    \"         }) || []).join(\\\";\\\"),\\n\")\n        }\n    }\n    code += (                \"        }\\n\" +\n                    \"        onOk(data)\\n\" +\n                    \"      })\\n\" +\n                    \"      .catch(errorInfo => {\\n\" +\n                    \"        console.log(errorInfo)\\n\" +\n                    \"      })\\n\" +\n                    \"  }\\n\" +\n                    \"\\n\" +\n                    \"  render() {\\n\" +\n                    \"    const { item = {}, onOk, form,options,optionValueLabel,trees, ...modalProps } = this.props\\n\" )\n    //初始化options\n    // fields.each() {\n    //     def frontType = it.frontType\n    //     if(frontType == \'select\' || frontType == \'checkbox\') {\n    //         code += (    \"    const ${it.camelCase}OptionData = Object.keys(options.${it.camelCase}).map((k,index)=>{\\n\" )\n    //         if(it.javaType == \'String\') {\n    //             code += (\"      return {value: k, label: options.${it.camelCase}[k]}\\n\")\n    //         } else {\n    //             code += (\"      return {value: parseInt(k), label: options.${it.camelCase}[k]}\\n\")\n    //         }\n    //         code += (                \"    })\\n\"\n    //         )\n    //     }\n    // }\n    //初始化时间相关参数\n    code += (\"    let initData = {\\n\")\n    //初始化默认值\n    fields.each() {\n         if(it.defaultValue != null && it.defaultValue != null) {\n            code += (\"${it.name}: ${it.defaultValue},\\n\")\n        }\n    }\n\n    code += (\"                    ...item};\\n\")\n    code += (\"    //初始化时间处理\\n\")\n    fields.each() {\n        def frontType = it.frontType\n        if(frontType == \'datetime\') {\n            code += (\"    if(item.${it.camelCase}) initData[\'${it.camelCase}\'] = moment(item.${it.camelCase},${frontType}Format)\\n\")\n        } else if (frontType == \'date\') {\n            code += (\"    if(item.${it.camelCase}) initData[\'${it.camelCase}\'] = moment(item.${it.camelCase},${frontType}Format)\\n\")\n        } else if (frontType == \'upload\') {\n            code += (\"   initData[\'${it.camelCase}\'] = (initData.${it.camelCase}?.split(\';\').map((item, key) => {\\n\" +\n                    \"        return {\\n\" +\n                    \"          uid: -key,\\n\" +\n                    \"          key: item,\\n\" +\n                    \"          name: item,\\n\" +\n                    \"          url: item\\n\" +\n                    \"        }\\n\" +\n                    \"      }) || []);\\n\")\n        }\n    }\n    code += (\n                    \"    return (\\n\" +\n                    \"\\n\" +\n                    \"      <Modal {...modalProps} onOk={this.handleOk} width={1300}>\\n\" +\n                    \"        <Form ref={this.formRef} name=\\\"control-ref\\\" initialValues={{ ...initData }} layout=\\\"horizontal\\\">\\n\"\n    );\n\n            fields.each() {\n                if(it.camelCase != \'id\' && it.camelCase != \'createdTime\' && it.camelCase != \'updatedTime\') {\n                    def maxStr = \"\"\n                    def max = tool.getFrontMax(it)\n                    def minStr = \"\"\n                    def min = tool.getFrontMin(it)\n                    if(max) {\n                        maxStr = \", max: \\\"${max}\\\"\"\n                    }\n                    if(min != null) {\n                        minStr = \", min: \\\"${min}\\\"\"\n                    }\n                    //def ftable = tool.getForeignTableCapitalKey(it.comment)\n                    code += (\n                            \"         <FormItem  \" +\n                           //         \"frontStep=\'${it.frontStep}\' frontMax=\'${it.frontMax}\' frontLength=\'${it.frontLength}\' l=\'${it.length}\' t=\'${it.scale}\' \" +\n                                    \"name=\'${it.camelCase}\' rules={[{ required: ${it.isNotNull} }]}\"\n                    )\n                    def frontType = it.frontType\n                    if(frontType == \'select\') {\n                        code += (\n                                        \"            label={t`${it.frontName}`} hasFeedback {...formItemLayout}>\\n\" +\n                                        \"           <Select\\n\" +\n                                        \"             showSearch\\n\" +\n                                        \"             placeholder={t`${it.frontName}`}\\n\" +\n                                        \"             optionFilterProp=\\\"children\\\"\\n\" +\n                                        \"             options={optionValueLabel.${it.camelCase}}\\n\" +\n                                        \"             disabled={${it.editReadOnly}}\\n\" +\n                                        \"             />\\n\"\n                        )\n                    } else if(frontType == \'treeSelect\') {\n                        code += (\n                                \"            label={t`${it.frontName}`} hasFeedback {...formItemLayout}>\\n\" +\n                                        \"       <TreeSelect\\n\" +\n                                        \"             showSearch\\n\" +\n                                        \"             style={{ width: \'100%\' }}\\n\" +\n                                        \"             // value={value}\\n\" +\n                                        \"             dropdownStyle={{ maxHeight: 400, overflow: \'auto\' }}\\n\" +\n                                        \"             placeholder=\\\"Please select\\\"\\n\" +\n                                        \"             allowClear\\n\" +\n                                        \"             treeDefaultExpandAll\\n\" +\n                                        \"             // onChange={onChange}\\n\" +\n                                        \"             disabled={${it.editReadOnly}}\\n\" +\n                                        \"             treeData={addRootNode(trees?.${it.camelCase})}\\n\" +\n                                        \"           />\\n\"\n                        )\n                    } else if(frontType == \'checkbox\') {\n                        code += (\n                                        \"            label={t`${it.frontName}`} hasFeedback {...formItemLayout}>\\n\" +\n                                        \"           <Checkbox.Group\\n\" +\n                                        \"             options={optionValueLabel.${it.camelCase}}\\n\" +\n                                        \"           />\\n\"\n                        )\n                    } else if(frontType == \'datetime\' || frontType == \'date\') {\n                        code += (\n                                        \"            label={t`${it.frontName}`} hasFeedback {...formItemLayout}>\\n\" +\n                                        \"            <DatePicker disabled={${it.editReadOnly}} format={${frontType}Format} showNow showTime={{ format: ${frontType}Format }} />\\n\"\n                        )\n                    } else if(frontType == \'upload\') {\n                        def uploadCount = tool.getExtendData(it.comment, \'uploadCount\', \'1\')\n                        code += (\n                                        \"             valuePropName={\\\"defaultFileList\\\"} label={t`${it.frontName}`} hasFeedback {...formItemLayout}>\\n\" +\n                                        \"           <Upload listType=\\\"picture-card\\\"\\n\" +\n                                        \"                   // defaultFileList={defaultFileList}\\n\" +\n                                        \"                   name=\\\"avatar\\\"\\n\" +\n                                        \"                   action={createUserAvatar}\\n\" +\n                                        \"                   disabled={${it.editReadOnly}}\\n\" +\n                                        \"                   // onChange={this.handleChange}\\n\" +\n                                        \"                   headers={{Authorization:store.get(\'token\')}}\\n\" +\n                                        \"                   maxCount={${uploadCount}}>\\n\" +\n                                        \"             <div>\\n\" +\n                                        \"               <PlusOutlined />\\n\" +\n                                        \"               <div style={{ marginTop: 8 }}>Upload</div>\\n\" +\n                                        \"             </div>\\n\" +\n                                        \"           </Upload>\\n\"\n                        )\n                    } else if(frontType == \'number\') {\n                        code += (\n                                \"            label={t`${it.frontName}`} hasFeedback {...formItemLayout}>\\n\" +\n                                        \"            <InputNumber\\n\" )\n                        //校验规则\n//                        if(min) code += (\" minLenght={${min}}\")\n//                        if(max) code += (\" maxLength={${max}}\")\n                        if(it.frontMax) code += (\" max={${it.frontMax}}\")\n                        if(it.frontStep) code += (\" step=\\\"${it.frontStep}\\\"\")\n                        code += (\"  style={{width:200}}\")\n                        code += \"             disabled={${it.editReadOnly}}\\n\"\n                        code += (\" />\\n\")\n                    } else if (frontType == \'editor\') {\n                        code += (\n                                \"           label={t`${it.frontName}`} hasFeedback {...formItemLayout}>\\n\" +\n                                        \"           <QuillEditor disabled={${it.editReadOnly}} />\\n\"\n                        )\n                    } else if(frontType == \'password\') {\n                        code += (\n                                \"            label={t`${it.frontName}`} hasFeedback {...formItemLayout}>\\n\" +\n                                        \"            <Input.Password\\n\" )\n                        //校验规则\n                        if(min) code += (\" minLenght={${min}}\")\n                        if(max) code +=(\" maxLength={${max}}\")\n                        code += \"             disabled={${it.editReadOnly}}\\n\"\n                        code += (\" />\\n\")\n                    } else if (frontType == \'textArea\') {\n                        code += (\n                                \"            label={t`${it.frontName}`} hasFeedback {...formItemLayout}>\\n\" +\n                                        \"            <TextArea\" )\n                        code += \"             disabled={${it.editReadOnly}}\\n\"\n                        //校验规则\n//                        if(min) code += (\" minLenght={${min}}\")\n//                        if(max) code += (\" maxLength={${max}}\")\n                        code += (\" />\\n\")\n                    } else if (frontType == \'uploadEditor\') {\n                        code += (\n                          \"            label={t`${it.frontName}`} hasFeedback {...formItemLayout}>\\n\" +\n                          \"            <UploadEditor disabled={${it.editReadOnly}}  />\\n\")\n                    } else {\n                        code += (\n                                        \"            label={t`${it.frontName}`} hasFeedback {...formItemLayout}>\\n\" +\n                                        \"            <Input\" )\n                        code += \"             disabled={${it.editReadOnly}}\\n\"\n                        //校验规则\n                        if(min) code += (\" minLenght={${min}}\")\n                        if(max) code += (\" maxLength={${max}}\")\n                                                code += (\" />\\n\")\n\n                    }\n                    code += (\"          </FormItem>\\n\")\n                }\n            }\n\n    code += (                    \"        </Form>\\n\" +\n                    \"      </Modal>\\n\" +\n                    \"    )\\n\" +\n                    \"  }\\n\" +\n                    \"}\\n\" +\n                    \"\\n\" +\n                    \"${t.upperCamelCase}Modal.propTypes = {\\n\" +\n                    \"  type: PropTypes.string,\\n\" +\n                    \"  item: PropTypes.object,\\n\" +\n                    \"  onOk: PropTypes.func,\\n\" +\n                    \"}\\n\" +\n                    \"\\n\" +\n                    \"export default ${t.upperCamelCase}Modal\\n\"\n    );\n}','2022-12-24 22:03:08',0),(1170362387,1736609793,'javaApprovalListener','Java Approval Event Listener',1,'//前端模块页面\ndef main(t) {\n  def str = \"\" + getFileName(t) + \"\\n--------------------------\\n\" +  getCode(t)\n  str\n}\n\ndef getFileName(tableVo) {\n    def tool = shell.parse(context.codeTableTemplateService.getById(1).code)\n    def t = tool.calcTable(tableVo)\n  if(t.approval != null) {\n    return \"src/main/java/\"+baseNamespace.replace(\".\", \"/\") + \"event/\" +\"${t.upperCamelCase}ApprovalEventListener.java\"\n  }\n  null\n}\n\ndef getCode(t) {\n  createCode(t)\n} \n\n//TODO 1 调整审批单号；2 调整整理审批通过，拒绝状态字段以及值 \ndef createCode(tableVo) {\n  def tool = shell.parse(context.codeTableTemplateService.getById(1).code)\n  def t = tool.calcTable(tableVo)\n  def fields = t.fields\n\n  //检查是否需要输出\n  if(t.approval == null) {\n    return null\n  }  \n\n  //获取审批ID\n  def applyId = tool.getPartData(t.approval, 0, \"~\", \"4\")\n  def idColumn = tool.getPartData(t.approval, 1, \"~\", \"id\")\n  \n  def  code = \"\"\n  //导入引入\n  code += \"package ${baseNamespace}event;\\n\" +\n          \"import lombok.RequiredArgsConstructor;\\n\" +\n          \"import lombok.extern.log4j.Log4j2;\\n\" +\n          \"import org.springframework.context.ApplicationListener;\\n\" +\n          \"import org.springframework.scheduling.annotation.Async;\\n\" +\n          \"import org.springframework.stereotype.Component;\\n\" +\n          \"import work.soho.approvalprocess.domain.ApprovalProcessOrder;\\n\" +\n          \"import work.soho.approvalprocess.event.ApprovalEvent;\\n\" +\n          \"import ${baseNamespace}domain.${t.upperCamelCase};\\n\" +\n          \"import ${baseNamespace}service.${t.upperCamelCase}Service;\\n\\n\" +\n\n          \"@RequiredArgsConstructor\\n\" +\n          \"@Component\\n\" +\n          \"@Log4j2\\n\" +\n          \"public class ${t.upperCamelCase}ApprovalEventListener implements ApplicationListener<ApprovalEvent> {\\n\"+\n          \"    /**\\n\" +\n          \"     * 审批流ID\\n\"+\n          \"     */\\n\"+\n\"    private static final String APPROVAL_NO = \\\"${applyId}\\\";\\n\\n\"+\n\"    final private ${t.upperCamelCase}Service ${t.camelCase}Service;\\n\\n\" +\n\n    \"    @Override\\n\"+\n\"    @Async\\n\"+\n\"    public void onApplicationEvent(ApprovalEvent event) {\\n\"+\n\"        ApprovalProcessOrder order = (ApprovalProcessOrder) event.getSource();\\n\"+\n\"        //检查师傅为当前对应审批流\\n\"+\n\"        if(!event.getApprovalProcessNo().equals(APPROVAL_NO)) {\\n\"+\n\"            return;\\n\"+\n\"        }\\n\"+\n\"        //处理业务逻辑，　修改样例状态为审批通过\\n\"+\n\"        if(order.getStatus() == 1) {\\n\"+\n\"            ${t.upperCamelCase} ${t.camelCase} = ${t.camelCase}Service.getById(order.getOutNo());\\n\"+\n\"            if(${t.camelCase} != null) {\\n\"+\n\"                if(order.getApplyStatus() == 2) {\\n\"+\n\"                    //审批通过\\n\"+\n\"                    ${t.camelCase}.setStatus(1);\\n\"+\n\"                } else if(order.getApplyStatus() == 1){\\n\"+\n\"                    //审批拒绝\\n\"+\n\"                    ${t.camelCase}.setStatus(2);\\n\"+\n\"                }\\n\"+\n    //TODO 根据唯一ID进行更新\n\"                ${t.camelCase}Service.updateById(${t.camelCase});\\n\"+\n\"            } else {\\n\"+\n\"                log.error(\\\"无效审批单: {}\\\", event);\\n\"+\n\"            }\\n\"+\n\"        } else {\\n\"+\n\"            log.info(\\\"审批中间环节： {}\\\", event);\\n\"+\n\"        }\\n\"+\n\"    }\"\n\n  code += \"\\n}\"\n  \n  code\n}','2022-12-31 01:02:37',0),(1170362388,1736609793,'enums','Java枚举生成',1,'//页面生成模板\ndef main(t) {\n  def str = \"\" + getFileName(t) + \"\\n--------------------------\\n\" +  getCode(t)\n  str\n}\n\ndef getFileName(tableVo) {\n  def tool = shell.parse(context.codeTableTemplateService.getById(1).code)\n  def t = tool.calcTable(tableVo)\n  \"src/main/java/\" + baseNamespace.replace(\".\", \"/\") + \"enums/\" +\n  \"${t.upperCamelCase}Enums.java\"\n}\n\ndef getCode(t) {\n  createCode(t)\n} \n\n\ndef createCode(tableVo) {\n  def tool = shell.parse(context.codeTableTemplateService.getById(1).code)\n  def t = tool.calcTable(tableVo)\n  def fields = t.fields\n  def  code = \"\"\n\n  code += \"package ${baseNamespace}enums;\\n\\n\"+\n          \"import lombok.Getter;\\n\"+\n          \"import lombok.RequiredArgsConstructor;\\n\\n\"+\n          \"public class ${t.upperCamelCase}Enums {\";\n\n  fields.each() {\n    code += getFieldEnumCode(tool, it);\n  }\n\n  code += \"\\n}\";\n  \n  code //+ tool.cn2en(\"文章状态\").replaceAll(\" \", \"_\").toUpperCase()\n}\n\n// 获取字段枚举代码\ndef getFieldEnumCode(tool, field) {\n  def code = \"\"\n  if(field.options == null || field.options.size() == 1) {\n    return \"\";\n  }\n\n  code += \"\\n\\n    @RequiredArgsConstructor\\n\"+\n\"    @Getter\\n\" +\n\"    public enum ${field.upperCamelCase} {\\n\"\n\n  //TODO 确定最后一个枚举使用分号\n  int i =0;\n  field.options.each{ data ->\n    if(data != null && data.value != \'\') {\n      code += \"        \" + tool.cn2en(data.value).replaceAll(\" \", \"_\").toUpperCase() + \'(\' + data.key + \',\"\'+data.value+\'\")\'\n      i++\n      if(i<field.options.size()) {\n        code += \',\\n\'\n      }else {\n        code += \';\\n\'\n      }\n    }\n  }\n  code += \"        private final int id;\\n\" +\n          \"        private final String name;\\n\"\n  code += \"    }\"\n\n  //生成对应字段的枚举类型\n  code\n}','2023-03-25 17:19:26',0);
