INSERT INTO `groovy_info` VALUES (1,683810818,'test','class GroovyStringUtils {\n    // Function to check if a string is empty or null\n    static boolean isEmpty(String input) {\n        return input == null || input.trim() == \'\'\n    }\n\n    // Function to check if a string is not empty and not null\n    static boolean isNotEmpty(String input) {\n        return !isEmpty(input)\n    }\n\n    // Function to reverse a string\n    static String reverse(String input) {\n        return input.reverse()\n    }\n\n    // Function to count the number of occurrences of a substring in a string\n    static int countOccurrences(String input, String substring) {\n        int count = 0\n        int index = 0\n        while ((index = input.indexOf(substring, index)) != -1) {\n            count++\n            index += substring.length()\n        }\n        return count\n    }\n\n    // Function to truncate a string to a given length\n    static String truncate(String input, int maxLength) {\n        return input.length() <= maxLength ? input : input[0..(maxLength - 1)]\n    }\n}',NULL,NULL),(2,683810818,'testRun','println \"hello groovy\"\nreturn \"rrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrr\"',NULL,'2023-08-15 17:05:56'),(3,683810819,'dbBackup','import groovy.sql.Sql\n\ndef url = \'jdbc:mysql://192.168.0.101:3306/dev\'\ndef username = \'dev\'\ndef password = \'dev\'\n\ndef sql = Sql.newInstance(url, username, password, \'com.mysql.cj.jdbc.Driver\')\n\ndef output = new File(\"/tmp/database_backup.sql\")\noutput.withWriter(\"UTF-8\") { out ->\n    sql.eachRow(\"SHOW TABLES\") { row ->\n        def table = row.TABLE_NAME.toString()\n        sql.eachRow(\"SELECT * FROM $table\") { row ->\n            out.println \"INSERT INTO $table VALUES (${row.values().join(\', \')})\"\n        }\n    }\n}','2023-11-24 21:54:19','2023-11-25 16:43:46');
